data:
  definition: deuxième version sonore de la tonalité d'invitation à numéroter, ayant
    la fonction auxiliaire de rappeler au demandeur que la ligne et le numéro qu'il
    utilise font l'objet d'un service supplémentaire en cours, par exemple, un service
    qui empêche la réception d'une tentative d'appel
